import React from "react";
import Experience from "./components/Experience";
import Education from "./components/Education";
import About from "./components/About";


const education = [
    {
        id: 1,
        school: 'Haaga-Helia University of Applied Sciences',
        degree: "Business Information Technology, Bachelor's Degree",
        startTime: '1/2014',
        endTime: '9/2018',
    },
    {
        id: 2,
        school: 'Eira High School for Adults',
        degree: 'The Finnish Matriculation Examination',
        startTime: '1/2008',
        endTime: '6/2013',
    }
]

const experience = [
    {
        id: 1,
        title: 'Membership Specialist',
        description: 'Maintaining and participating in the development of the membership register.',
        organization: 'The Federation of Public and Private Sector Employees Jyty',
        startTime: '10/2018',
        endTime: '8/2019',
    },
    {
        id: 2,
        title: 'Web Marketing Intern',
        description: 'Worked on Koulutus.fi website. Managed SEO, usability, content, social media, marketing materials and customer service.',
        organization: 'EMG - Educations Media Group',
        startTime: '2/2018',
        endTime: '7/2018',
    },
    {
        id: 3,
        title: 'Sales Promoter',
        description: 'Introducing products and representing brands to consumers in grocery stores and various events.',
        organization: 'Foodbrands Nordic Oy',
        startTime: '8/2016',
        endTime: '9/2017',
    },
    {
        id: 4,
        title: 'Airbnb Host',
        description: "Managed customers' needs and maintained the cleanliness of the apartment.",
        organization: '',
        startTime: '8/2014',
        endTime: '10/2015',
    },
    {
        id: 5,
        title: 'Care Assistant',
        description: 'Entertained elderly, e.g. played piano and did outdoor activities.',
        organization: 'City of Helsinki',
        startTime: '6/2011',
        endTime: '8/2011',
    },
    {
        id: 6,
        title: 'Personal Assistant',
        description: 'Assisted a lady in the office. Helped her in daily matters. She had a muscular dystrophy disease.',
        organization: 'City of Helsinki',
        startTime: '9/2007',
        endTime: '4/2008',
    },
]

const App = () => {

    return (

            <div className="grid-container">
                <div className="item1">About</div>
                <div className="item2">Skills</div>
                <div className="item3">
                    <h2>About me</h2>
                    <About />
                    <h2>Education</h2>
                    <ul>
                        {education.map(education => 
                            <Education key={education.id} education={education} />
                            )}
                    </ul>
                    <h2>Experience</h2> 
                    <ul>
                        {experience.map(experience => 
                            <Experience key={experience.id} experience={experience} />
                        )}
                    </ul>
                </div>
            </div>

    )
}

export default App;
